import '../styles/App.css';
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";


function App() {
  return (
  <>


    <div id="samarth" >
        <form  method="POST">
                    <h1>Login</h1>
                <div className="container">
                    <i className="fa fa-user" aria-hidden="true"></i>
                    <input type="text" 
                    value={user.login}
                    onChange={handleInputs}
                    placeholder="Login Id" name="login" />
            </div>
            <div className="container">
                <i className="fa fa-lock" aria-hidden="true"></i>
                <input type="password" 
                value={user.pass}
                onChange={handleInputs}  placeholder="password" name="pass" /><br />
            </div>
            <div id="third">
                <input  type="submit" value="submit"  className="btn" id="Aditya" 
                onClick={PostData} />

            </div>
       </form>
    </div>



  </>
  );
}
export default App;
